import React from "react";
import { Link } from "react-router-dom";

const Home = ({ meals_list }) => {
  return (
    <div>
      {meals_list.map((meal) => (
        <div key={meal.id}>
          <img src={meal.image_url} alt={meal.name} />
          <h2>{meal.name}</h2>
          <Link to={`/item/${meal.id}`}>
            <button>Ver detalles</button>
          </Link>
        </div>
      ))}
    </div>
  );
};

export default Home;
